description:
Let Nina Change Your Mind! Let Nina Change Your Mind! Katsuni's Killer Body! Oiling Ava! Bullied By Roxanne! Dana's Rules! Nina Hartley - Nina gets a visit from a young man seeking to extoll the virtues of celibacy, but she has some virtues of her own to change his outlook! Katsuni - When a young guy asks Katsuni for her daughter's hand in marriage, Katsuni makes sure he's ready to join the family! Ava Devine - Ava is on holiday. But before she hits the beach, she needs the hotel boy to bring up some lotion and oil her down! Roxanne Hall - Roxanne's son is the school bully. So when a nerd comes to tattle tale to her, she decides to help the weakling man up! Dana DeArmond - Just out of jail, this young buck is ready for action. But he'll have to play by Dana's rules, who's one tough parole officer!

